describe("ObjectLikeSequence",function(){describe("keys",function(){var keys=Lazy({foo:1,bar:2}).keys();it("works with getIterator as you would expect",function(){var iterator=keys.getIterator();expect(iterator.moveNext()).toBe(true);expect(iterator.current()).toBe("foo");expect(iterator.moveNext()).toBe(true);expect(iterator.current()).toBe("bar");expect(iterator.moveNext()).toBe(false)})});describe("values",function(){var values=Lazy({foo:1,bar:2}).values();it("works with getIterator as you would expect",function(){var iterator=values.getIterator();expect(iterator.moveNext()).toBe(true);expect(iterator.current()).toBe(1);expect(iterator.moveNext()).toBe(true);expect(iterator.current()).toBe(2);expect(iterator.moveNext()).toBe(false)})})});